import React from 'react';
import './App.css';

import './Components/header/Header';
import Header from './Components/header/Header';
function App() {
  return (
    <div className="App">
      <Header></Header>
      <p>Weane, the new way to get weather and news at a specific location</p>
    </div>
  );
}

export default App;
